  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"install"}}>{`Install`}</MDXTag>
<MDXTag name="p" components={components}>{`current version: 1.0.8`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`npm i -S react-google-maps-api @babel/polyfill @babel/runtime
`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}>{`and`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`npm i -D @babel/preset-env @babel/preset-react @babel/plugin-proposal-object-rest-spread @babel/plugin-proposal-class-properties @babel/plugin-transform-spread @babel/plugin-syntax-dynamic-import @babel/plugin-transform-runtime babel-plugin-macros babel-plugin-transform-react-remove-prop-types
`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}>{`Import `}<MDXTag name="inlineCode" components={components} parentName="p">{`@babel/polyfill`}</MDXTag>{` to the top off your app`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-javascript"}}>{`import "@babel/polyfill";
`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}>{`If you do not have `}<MDXTag name="inlineCode" components={components} parentName="p">{`.babelrc`}</MDXTag>{` file, create it next to `}<MDXTag name="inlineCode" components={components} parentName="p">{`package.json`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}>{`Content of `}<MDXTag name="inlineCode" components={components} parentName="p">{`.babelrc`}</MDXTag>{` should look like this:`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`{
  "presets": [
    "@babel/preset-env",
    "@babel/preset-react"
  ],
  "plugins": [
    "@babel/plugin-transform-spread",
    "@babel/plugin-proposal-object-rest-spread",
    "@babel/plugin-proposal-class-properties",
    "@babel/plugin-syntax-dynamic-import",
    [
      "@babel/plugin-transform-runtime",
      {
        "corejs": false,
        "helpers": true,
        "regenerator": true,
        "useESModules": false
      }
    ],
    "babel-plugin-macros"
  ],
  "env": {
    "production": {
      "plugins": [
        "babel-plugin-transform-react-remove-prop-types"
      ]
    }
  }
}
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
